        this["Func_convert_ArgDesc_1"] = "A mértékegység, amelyben a szám meg van adva.\r\n\r\nSúly- és tömeg: \"g\" = gramm; \"sg\" = slug; \"lbm\" = font (avoirdupois); \"u\"= U (atomi tömegegység); \"ozm\" = uncia (avoirdupois)\r\nTávolság: \"m\" = méter; \"mi\" = szárazföldi mérföld; \"Nmi\" = tengeri mérföld; \"in\" = hüvelyk; \"ft\" = láb; \" yd \" = yard; \"ang\" = Angström; \"Pica\" = pica (1/72 hüvelyk)\r\nIdő: \"yr\" = év; \"day\" = nap; \"hr\" = óra; \"mn\" = perc; \"sec\" = másodperc\r\nNyomás: \"Pa\" (vagy \"p\") = Pascal; \"atm\" (vagy \"at\") = atmoszféra; \"Hgmm\" = higanymilliméter\r\nErő: \"N\" = Newton; \"dyn\" (vagy \"dy\") = din; \"lbf\" = font (súly)\r\nEnergia: \"J\" = Joule; \"e\" = erg; \" c \" = termodinamikai kalória; \"cal\" = IT kalória; \"eV\" (vagy \"ev\") = elektronvolt; \"HPh\" (vagy \"hh\") = lóerő-óra; \"Wh\" (vagy \"wh\") = Watt-óra; \"flb\" = láb-font; \"BTU\" (vagy \"btu\") = BTU\r\nTeljesítmény: \"HP\" (vagy \"h\") = lóerő; \"W\" (vagy \"w\") = Watt\r\nMágnesesség: \"T\" = Tesla; \"ga\" = Gauss\r\nHőmérséklet: \"C\" (vagy \"cel\") = Celsius fok; \"F\" (vagy \"fah\") = Fahrenheit fok; \"K\" (vagy \"kel\") = Kelvin\r\nFolyadékmérték: \"tsp\" = teáskanál; \"tbs\" = evőkanál; \"oz\" = folyékony uncia; \"cup\" = csésze; \"pt\" (vagy \"us_pt\") = pint (amerikai); \"uk_pt\" = pint (angol); \"qt\" = quart; \"gal\"= gallon; \"l\" (vagy \"lt\") = liter\r\n\r\nA metrikus mértékegységek előtt az alábbi előtagok állhatnak: exa (\"E\") = 1E+18; peta (\"P\") = 1E+15; tera (\"T\") = 1E+12; giga (\"G\") = 1E+09; mega (\"M\") = 1E+06; kilo (\"k\") = 1E+03; hekto (\"h\") = 1E+02; deka (\"e\") = 1E+01; deci (\"d\") = 1E-01; centi (\"c\") = 1E-02; milli (\"m\") = 1E-03; mikro (\"u\") = 1E-06; nano (\"n\") = 1E-09; pico (\"p\") = 1E-12; femto (\"f\") = 1E-15; atto (\"a\") = 1E-18\r\n    ";
